import '../../../../../../styles/sidebar.css';

export default function CustomerPurchaseSidebar(props) {

    return (
        <div className="side-bar">
            <div className="side-bar-div"><button className="side-bar-button" title="All Coupons">All Coupons</button></div>
            <div className="side-bar-div"><button className="side-bar-button" title="Coupons By Category">Search Category</button></div>
            <div className="side-bar-div"><button className="side-bar-button" title="All Coupons">Search Price</button></div>
        </div>
    )
}
